pub fn get_bigquery_root_grammar_id() -> GrammarId {
    GrammarId(1701)
}
pub fn get_bigquery_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_bigquery_root_grammar_id(),
        tables: &BIGQUERY_TABLES,
    }
}
pub fn get_bigquery_root_grammar() -> RootGrammar {
    get_bigquery_root_grammar_table()
}
